import React from 'react';
import { briefcase, circlemenu, stateboard } from '../Assets/icons/Icons';

const Sidebar = () => {
  return (
    <div className='sidebar w-1/6'>
      <div className='mt-12 ml-10'>
        <img src={briefcase} alt="briefcase" />
        <img src={stateboard} alt="stateboard" />
      </div>
      <div className='flex mt-40 ml-6 content-center'>
        <button className='bg-white w-full content-center rounded-l-lg flex items-center h-11'>
          <img src={circlemenu} alt="circlemenu" />
          <p className="ml-2">Dashboard</p>
        </button>
      </div>
    </div>
  );
}

export default Sidebar;
